import React from 'react';
import { makeStyles, TextareaAutosize } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    padding: '10px'
  },
}))

const Home = () => {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <h1>Welcome to my catalog</h1>
    </div>
  )
}

export default Home;
